import React from 'react';
import './App.css';
import Header from './Header.js';
import Technologies from './Technologies.js';
import Footer from './Footer.js';

const App = () => {
  return (
    <div>
      <header>
        <img src='https://img.freepik.com/free-vector/bird-colorful-logo-gradient-vector_343694-1365.jpg?size=338&ext=jpg&ga=GA1.1.1413502914.1725235200&semt=ais_hybrid' />
      </header>
      <nav>
        <div>Home</div>&nbsp;&nbsp;<div>About</div>&nbsp;&nbsp;
        <div>Skills</div>&nbsp;&nbsp;
        <div>Favourite</div>&nbsp;&nbsp;
        <div>Contact</div> 
      </nav>
    </div>
  );
}

export default App;
